import Header from "./Component/Header";
import Body from "./Component/Body";
import "./App.css";

function App() {
  const obj = {
    name: "Jake",
    age: 45,
  };

  return (
    <div className="App-header">
      {/* Passing values to Header */}
      <Header myStr={"Some string"} myNum={42354} myObj={obj} />
      <Body />
    </div>
  );
}

export default App;
